import React from 'react'
import Avatar from '../Avatar'

const SearchCard = ({user}) => {
  return (
    <div className="d-flex p-2 align-items-center">
        <Avatar src={user.avatar} size="big-avatar"/>
    </div>
  )
}

export default SearchCard
